import math
import collections

def max_gcd_from_product(N, P):

    def trial_division(n):
        factor = []
        tmp = int(math.sqrt(n)) + 1
        for num in range(2, tmp):
            while n % num == 0:
                n //= num
                factor.append(num)
        if not factor:
            return [n]
        else:
            factor.append(n)
            return factor
    lst = trial_division(P)
    c_lst = collections.Counter(lst)
    ans = 2
    for (k, v) in c_lst.items():
        while v >= N:
            ans *= k
            v -= N
    return ans

